/* eslint-disable */

function Search(breed, typeSelect, names) {
  const queryWords = "";
  const arr = names.split(" ");
  if (typeSelect === "고양이") {
    queryWords = breed + " 고양이";
  } else {
    queryWords = breed + " 강아지";
  }

  const data = breed + typeSelect;
  return data;
}

export default Search;
